import React from "react";
import "./styles/CheckPoint.css";
import HeaderBasic from "./HeaderBasic";
import HistoryItem from "./HistoryItem";
import BottomBar from "./BottomBar";

function CheckPoint() {
  const historyData = [
    {
      title: "퍼즐 게임",
      date: "2024.05.08 14:15:21",
      description: "게임 클리어",
      points: "+1,500P",
      status: "적립",
      isPositive: true,
    },
    {
      title: "퍼즐 게임",
      date: "2024.05.08 14:15:21",
      description: "게임 클리어",
      points: "-1,500P",
      status: "사용",
      isPositive: false,
    },
    {
      title: "퍼즐 게임",
      date: "2024.05.08 14:15:21",
      description: "게임 클리어",
      points: "+1,500P",
      status: "적립",
      isPositive: true,
    },
    {
      title: "회원 가입",
      date: "2024.05.08 14:15:21",
      description: "회원 가입",
      points: "+2,000P",
      status: "적립",
      isPositive: true,
    },
  ];
  return (
      <>
        <HeaderBasic />
        <div className="screen">
          <div className="point-history-title">
            <div className="point-history-container">
              <div className="point-history-text">포인트 내역</div>
            </div>
          </div>
          <div className="points-history">
            {historyData.map((item, index) => (
                <HistoryItem
                    key={index}
                    title={item.title}
                    date={item.date}
                    description={item.description}
                    points={item.points}
                    status={item.status}
                    isPositive={item.isPositive}
                />
            ))}
          </div>
          <div className="points-banner">
            <div className="banner-text">보유 포인트:3500P</div>
          </div>
        </div>
        <BottomBar />
      </>
  );
}

export default CheckPoint;
